scriptlet.script:
//-------------------------------------------------------------------
// find the key "config.network.vnic"
var vnicKey="config.network.vnic";
data = String(scriptletInput);
var i = data.indexOf(vnicKey);
var ipAddressValue = null;
if( i != -1 )
{
// OK. found 
   // Find the array starting symbol: [
   i = data.indexOf("[");
   if( i != -1 ) {
	// truncate.
	data = data.slice( i + 1 );

	var count = 0;
	var start=-1, close = -1;
	var fromIndex = 0;

		for ( i = 0; i < data.length; i ++ ) {
			ch = data.charAt(i);

			if( ch == '{'){
				count ++;
				if( start == -1 ) start = i;
			}else if ( ch == '}') {
				count --;
				close = i;

				if( count == 0 ) {
				 // Found a entry. 

					entry = data.slice(start + 1, close );
					// Check if this entry is for the Management Network.
					mgmtIndex = entry.indexOf("Management Network");
					if( mgmtIndex != -1 ) {
						// Great We found it.
						//Get the Ip address field:
						ipAddressConst = "ipAddress";
						ipAddrIndex = entry.indexOf(ipAddressConst);
						if(ipAddrIndex != -1 )
						{
							// Get the value closing symbol ",".
							valueEndIndex = entry.indexOf(",", ipAddrIndex);
							if( valueEndIndex != -1 )
							{
								// slice out the ipAddress Value.
								ipAddressValue = entry.slice( ipAddrIndex + ipAddressConst.length + 1, valueEndIndex);

							}
						}

						break;

					}else {
						// Well not this entry. Let's try the next.

						//Reset start.
						start = -1;

					}
				 }

			}



		}


   }else {
     // well, data error.
   }
}else {
// well, no matching
}
scriptletResult = ipAddressValue;
//----------------------------------------------------------------
//console.log("Found address: [%s]", ipAddressValue);
